import { Button, Modal, Form, Input, Table } from "antd";
import { AudioOutlined } from '@ant-design/icons';
import { useState } from "react";
import tableListStudent from "./listStudent";
const { Search } = Input;




function Content() {
    const columns = [
        {
            title: "Name",
            dataIndex: "name",
            width: 170,
            align: "left",
        
            render: _ => <a>{_}</a>,
          },
          {
            title: "Day of birth",
            dataIndex: "dob",
            align: "center",
            width: 120,
        
          },
          {
            title: "Gender",
            dataIndex: "gender",
            align: "center",
            width: 100,
        
          },
          {
            title: "Class",
            dataIndex: "class",
            align: "center",
            width: 100,
        
          },
          {
            title: "Hometown",
            dataIndex: "hometown",
            align: "center",
            width: 120,
        
          },
          {
            title: "Phone Number",
            dataIndex: "phone",
            align: "center",
            width: 120,
        
          },

    ]

return 
}
export default Content;
